<script>
export default {
  props: {
    deg: {
      type: Number,
      default: 0
    }
  },
  data: function () {
    return {
      isShow_svg1: true,
      isShow_me1: false,
      isShow_me2: false,
      isShow_me3: false,
      isShow_leaf: false,
      isShow_seed: true,
      isShow_ground: true,

      isShow_svg2: false,
      isShow_seed_leaf_wrap2: false,
      isShow_miki_wrap: false,
      isShow_miki_wrap2: false,
      isShow_miki_2: false
    }
  },
  watch: {
    deg() {
      this.draw(this.deg)
    }
  },
  methods: {
    draw(deg) {
      console.log(deg)
      if (deg > 5) {
        this.isShow_me1 = true
      } else {
        this.isShow_me1 = false
      }
      if (deg > 10) {
        this.isShow_me2 = true
      } else {
        this.isShow_me2 = false
      }
      if (deg > 15) {
        this.isShow_me3 = true
      } else {
        this.isShow_me3 = false
      }
      if (deg > 20) {
        this.isShow_leaf = true
      } else {
        this.isShow_leaf = false
      }
      if (deg > 25) {
        this.isShow_svg1 = false
        this.isShow_svg2 = true
        this.isShow_seed_leaf_wrap2 = true
      } else {
        this.isShow_svg1 = true
        this.isShow_svg2 = false
        this.isShow_seed_leaf_wrap2 = false
      }
      if (deg > 30) {
        this.isShow_miki_wrap2 = true
        this.isShow_miki_2 = true
        this.isShow_seed_leaf_wrap2 = false
      } else {
        this.isShow_miki_wrap2 = false
        this.isShow_miki_2 = false
        this.isShow_seed_leaf_wrap2 = true
      }
      if (deg > 35) {
        this.isShow_miki_wrap = true
        this.isShow_miki_2 = false
      } else {
        this.isShow_miki_wrap = false
        this.isShow_miki_2 = true
      }
    }
  },
  mounted() {
    this.draw(this.deg)
  }
}
</script>

